import React from 'react';
import styled from 'styled-components';

export default function RecipeCard(props) {
  return (
              <li style={ {position: 'relative'} } key={ props.id }> 
    <Div> 
      <p> 
        { props.title }  
      </p>
      <p> 
        { props.image }  
      </p>
      <p> 
        { props.dishTypes }  
      </p>
      <p> 
        { props.diets }  
      </p>
    </Div>
              </li>
  )
};

const Div = styled.div`
  position: relative; 

  padding: 0px;
  margin: 0px;
  background-color: green;
`;
